import Link from 'next/link'
const NavBar=()=>(
<nav className='navbar navbar-expand navbar-dark bg-dark mb4'>
    <div className='container'>
       
        <a className="navbar-brand" href="#">MajCoin</a>
        <div className="navbar-collapse collapse">
    <ul className="navbar-nav ml-auto">
    <li>
        <Link href="/"><a>Home</a></Link>
    </li>
    <li>
        <Link href="/about"><a>About</a></Link>
    </li>
</ul>

<style jsx>
    {`
    ul{
        background: #333;
        color: #fff;
        list-style: none;
        display: flex;
    }

     ul li{
        font-size: 28px;
        margin-right: 20px;
    }

    ul li a{
        color: #fff;
        text-decoration: none;
    }
    a:active{
        color:white;
    }`
    }
</style>
</div>
</div>
</nav>
)
export default NavBar
